import React from 'react';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className='app__navbar'>
      <div className='app__navbar-logo'>HONBAM</div>
      <ul className='app__navbar-logo'>
        <li className='p__hotplace'>
          <a href='#hotplace'>HOTPLACE</a>
        </li>
        <li className='p__recipe'>
          <a href='#recipe'>RECIPE</a>
        </li>
        <li className='p__chat'>
          <a href='#chat'>CHAT</a>
        </li>
        <li className='p__board'>
          <a href='#board'>BOARD</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
